export default function Basket({card}) {
  return (
    <div>
      {card.map(element => {
        return (
          <div className='card-item' key={element.id}>
          <img src={element.image}/>
          <div c>
            <h1>{element.title}</h1>
            <p>{element.price}</p>
          </div>
          </div>
        )
      })}
    </div>
  )
}
